import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  width: 100%;
  height: 60px;
  display: flex;
  justify-content: center;
  align-items: center;
  nav {
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 30px;
    border: 2px solid black;
    padding: 30px;
    box-shadow: 5px 5px 10px rgba(0, 0, 0, 0.7);
  }
  nav div {
  }
`;

const Home = () => {
  return (
    <Wrapper>
      <nav>
        <div>Anywhere</div>
        <div>Any week</div>
        <div>Add Guest</div>
      </nav>
    </Wrapper>
  );
};

export default Home;
